import React from 'react';

class MyComponent extends React.Component {
    state = {
        name: 'thái',
        age: 23,
    };
    onChangeInput = (even) => {
        console.log(even.target.value);
    };
    render() {
        return (
            <div>
                <form>
                    <input
                        type="text"
                        onChange={(even) => this.onChangeInput(even)}
                    />
                    <button>thay đổi</button>
                </form>
            </div>
        );
    }
}
export default MyComponent;
